commits.content:
.item {
  display: flex;
  font-size: 1.5rem;
  align-items: center;
  flex-direction: column;
  text-align: center;
  color: red;
}

.item span {
  display: block;
}

.icon {
  margin-right: 1rem;
  color: #18e0d0;
}

.icon svg {
  width: 2rem;
  height: 2rem;
}

@media (min-width: 768px) {
  .item {
    align-items: flex-start;
    text-align: left;
  }
}
